import PizzaCard from './PizzaCard'


const PizzaCardList = ({pizzas}) => {
	const pizzass = [{
    id: 1,
    ref: "pizza_tradicional",
    category: 0,
    name: "Bacon",
    price: "24 $R",
    unit: "picès",
    image: "Bacon.jpg",

  },
  {
    id: 1,
    ref: "pizza_tradicional",
    category: 0,
    name: "Bacon",
    price: "24 $R",
    unit: "picès",
    image: "Bacon.jpg",

  },
  {
    id: 1,
    ref: "pizza_tradicional",
    category: 0,
    name: "Bacon",
    price: "24 $R",
    unit: "picès",
    image: "Bacon.jpg",

  }];
	const PizaComponent = pizzass.map((pizza, i) => {
    return (
      <PizzaCard key={i}
        pizza = {pizza} />
    )
  })
  return (
  	<div className="AllSabores">
  	{PizaComponent}
    </div>
  );
};

export default PizzaCardList;
